import React from 'react';
import './Ourstats.css';
import CountTo from 'react-count-to';

function Ourstats() {
  return (
    <div className='stats-container'>
        <div> <CountTo to={80} speed={2500} /> + members</div>
        <div>1000 + memories created</div>
        <div>1 commuinity made</div>
    </div>  
  )
}

export default Ourstats
